import React from 'react'
import Admin from './Admin-page';
import Login from './Login';
import {
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Route exact path='/' element={<Login/>}></Route>
        <Route exact path='/admin' element={<Admin/>}></Route>

      </Switch>
    </>
  )
}

export default App
